import React from 'react';
import { Box, Typography, Button, TextField } from '@mui/material';

const Subscription = () => {
  return (
    <Box sx={{ padding: 4 }}>
      <Typography variant="h4" gutterBottom>
        Subscription Plans
      </Typography>
      <Typography variant="body1" gutterBottom>
        Choose your preferred subscription plan and enjoy daily fresh meals.
      </Typography>
      <TextField
        label="Email Address"
        variant="outlined"
        fullWidth
        sx={{ marginBottom: 2 }}
      />
      <Button variant="contained" color="primary" size="large">
        Subscribe Now
      </Button>
    </Box>
  );
};

export default Subscription;
